import React from "react";
import todoItem from "./components/todoItem";
function todoList() {
  return (
    <div>
      <todoList>
        <todoItem />
        <todoItem />
        <todoItem />
        <todoItem />
      </todoList>
    </div>
  );
}
export default todoList;
